"<html><head><meta name='viewport' content='width=device-width, initial-scale=1.0'><link rel='icon' type='image/png' href='data:image/png;base64,'><title>ESP32-Deagle</title></head><body><div class='cameraName'><h1>ESP32-Deagle System Manager <img style='width:2em;' id='camIcon' src='data:image/png;base64,'></h1></div><div class='paragraph'><div class='textBox'><div class='section'> Raw Stream Server: <div class='button'><a href='stream'>Launch</a></div></div><div class='section'><div class='toggleWithText'> Motion Detect Mode: &emsp; <label class='switch'><input type='checkbox' id='motionDetect' checked><span class='slider round'></span></label></div></div><div class='section'> Lamp Brightness: <input type='range' id='lampBrightness' min='0' max='100' step='1' value='0'></div></div><div class='textBox'><div class='section'><div class='toggleWithText'> Vertical Flip: &emsp; <label class='switch'><input type='checkbox' id='vflip' checked><span class='slider round'></span></label></div></div><div class='section'><div class='toggleWithText'> Horizontal Mirror: &emsp; <label class='switch'><input type='checkbox' id='hmirror' checked><span class='slider round'></span></label></div></div><div class='section'> Camera Brightness: <input type='range' class='custom-range' id='camBrightness' style='border-color:white;' min='-2' max='2' step='1' value='0'></div></div></div></body></html><script>;function handleLampBrightness(){var t=inputLampBrightness.value,e='/set-sensor?id=4&val='+t;fetch(e).then(response=>{console.log('request to '+e+' finished, status:'+response.status)})};function handleMotionDetect(){let eleVal=inputMotionDetect.checked;let value=0;if(eleVal==!0)value=1;var e='/set-sensor?id=6&val='+value;fetch(e).then(response=>{console.log('request to '+e+' finished, status:'+response.status)})};function handleVFlip(){let eleVal=inputVFlip.checked;let value=0;if(eleVal==!0)value=1;var e='/set-sensor?id=1&val='+value;fetch(e).then(response=>{console.log('request to '+e+' finished, status:'+response.status)})};function handleHMirror(){let eleVal=inputHMirror.checked;let value=0;if(eleVal==!0)value=1;var e='/set-sensor?id=2&val='+value;fetch(e).then(response=>{console.log('request to '+e+' finished, status:'+response.status)})};function handleCamBrightness(){var t=inputCamBrightness.value,e='/set-sensor?id=3&val='+t;fetch(e).then(response=>{console.log('request to '+e+' finished, status:'+response.status)})};var inputLampBrightness=document.getElementById('lampBrightness'),inputMotionDetect=document.getElementById('motionDetect'),inputVFlip=document.getElementById('vflip'),inputHMirror=document.getElementById('hmirror'),inputCamBrightness=document.getElementById('camBrightness');inputLampBrightness.addEventListener('change',handleLampBrightness);inputMotionDetect.addEventListener('change',handleMotionDetect);inputVFlip.addEventListener('change',handleVFlip);inputHMirror.addEventListener('change',handleHMirror);inputCamBrightness.addEventListener('change',handleCamBrightness);function setInitialSensorFetch(){fetch('/get-sensor').then(response=>response.json()).then(setInitialSensor)};function setInitialSensor(e){if(e['1']==0)inputVFlip.checked=!1;else if(e['1']==1)inputVFlip.checked=!0;if(e['2']==0)inputHMirror.checked=!1;else if(e['2']==1)inputHMirror.checked=!0;if(e['3']>=-2&&e['3']<=2)inputCamBrightness.value=e['3'];if(e['4']>=0&&e['4']<=100)inputLampBrightness.value=e['4'];if(e['6']==0)inputMotionDetect.checked=!1;else if(e['6']==1)inputMotionDetect.checked=!0};setInitialSensorFetch();</script><style>@media (max-width: 1000px){#camIcon{width:20% !important}h1{font-size:130%}.paragraph{margin-top:8% !important}.section{margin-top:5% !important}.cameraName{margin-top:10%;font-size:20px !important;border-radius:35px}.paragraph{flex-direction:column}.textBox{margin-right:0;margin-bottom:10px}}h1{padding-left:2%;padding-right:2%;display:flex;align-items:center;justify-content:center}h1 img{padding-left:2%}html{background-color:#d2e0ef}body{font-family:verdana, sans-serif}.cameraName{color:#cccccc;font-size:30px;width:100%;height:auto;text-align:center;padding-top:2%;padding-bottom:2%;border-radius:25px;background-color:#333333}.paragraph{display:flex;flex-wrap:wrap;margin-top:2%;font-size:20px;width:98%;height:auto;padding-top:2%;padding-bottom:2%;padding-left:2%;border-radius:25px;background-color:#f2f2f2}.textBox{flex:1;margin-right:10px}a{text-decoration:none;color:black}.button{display:inline;background-image:linear-gradient(to bottom right, #00ccff, #ccf5ff);border-radius:15px;padding:7px}.section{padding-top:3%;padding-bottom:3%}.switch{position:relative;display:inline-block;width:60px;height:34px;align-items:center}.switch input{opacity:0;width:0;height:0}.slider{position:absolute;cursor:pointer;top:0;left:0;right:0;bottom:0;background-color:#ccc;-webkit-transition:.4s;transition:.4s}.slider:before{position:absolute;content:'';height:26px;width:26px;left:4px;bottom:4px;background-image:linear-gradient(to bottom right, #e6e6e6, #cccccc);-webkit-transition:.4s;transition:.4s}input:checked + .slider{background-color:#00ccff}input:focus + .slider{box-shadow:0 0 1px #00ccff}input:checked + .slider:before{-webkit-transform:translateX(26px);-ms-transform:translateX(26px);transform:translateX(26px)}.slider.round{border-radius:34px}.slider.round:before{border-radius:50%}.toggleWithText{padding-top:0%;padding-bottom:0%;display:inline-flex;align-items:center}</style>";
